import React, { Component } from  'react';

class  App extends Component {
    render(){
       return(
        <div>
            <div className="fixedMenu">
                <div className="ui container">
                    <a  href="#" className="ui button">
                        Home                    
                    </a>
                </div>
            </div>
        </div>
       );
    }
}


export default App;
